data: {"id":"f9cfb9ec-bf89-4a6a-b96f-717ad81a493b","model":"gpt-35-turbo","created":1703012939,"object":"extensions.chat.completion.chunk","choices":[{"index":0,"delta":{"context":{"messages":[{"role":"tool","content":"{\"citations\":[{\"content\":\"<h2 id=\\\"ai-cognitive-services-sdk-releases\\\">AI Cognitive Services SDK Releases</h2>\\n<ul>\\n<li>\\\"When's the next release?\\\"</li>\\n<li>\\\"How long is there left to get this change in?\\\"</li>\\n<li>\\\"When did we release that old version?\\\"</li>\\n</ul>\\n<h3 id=\\\"current-in-development-release\\\">Current, in-development release</h3>\\n<table>\\n<thead>\\n<tr>\\n<th>Sprint Label</th>\\n<th>Version - Speech</th>\\n<th>Version - Vision</th>\\n<th>All PRs out</th>\\n<th>Release by</th>\\n<th>Notes</th>\\n</tr>\\n</thead>\\n<tbody>\\n<tr>\\n<td>202301</td>\\n<td>1.25.0</td>\\n<td>0.7</td>\\n<td>Fri Jan 13</td>\\n<td>Fri Jan 27</td>\\n<td></td>\\n</tr>\\n</tbody>\\n</table>\\n<p><strong>\\\"PR complete\\\" and \\\"release by\\\"</strong></p>\\n<p>We generally talk about two dates when it comes to upcoming releases:</p>\\n<ul>\\n<li><strong>PR complete</strong> or <strong>\\\"all PRs out by\\\"</strong>: this is the date when all pull requests that are intended to be part of the release should be functionally complete and out for review. It's OK if it still needs a few updates, but expectations on pending PRs should be that they'll wrap up within a business day or two. This is what's tracked in our sprints.</li>\\n<li><strong>Release</strong> or <strong>\\\"release by\\\"</strong>: This is roughly the \\\"P95\\\" estimate for the latest the publicly-available release packages are published and available under the assumption that the corresponding PR complete date holds. This is an <em>estimate</em> that's intended to be conservative -- most releases happen before the projected date, but <strong>release is always gated by readiness</strong> and it's possible for things to get postponed. Estimated release dates may be communicated to customers, but only with the clarification that it's a target and not a guarantee.</li>\\n</ul>\\n<p>The single \\\"source of truth\\\" for the SDK's \\\"PR complete\\\" date is the sprint definition on Azure DevOps: <a href=\\\"https://msasg.visualstudio.com/Skyman/_sprints/taskboard/Carbon%20Team/Skyman/Carbon/\\\">https://msasg.visualstudio.com/Skyman/_sprints/taskboard/Carbon%20Team/Skyman/Carbon/</a></p>\\n<p>See the sprint date range definition in the upper right, e.g.:</p>\\n<p><img alt=\\\"image\\\" src=\\\"https://media.microsoft.ghe.com/user/5475/files/00c74e6f-de09-45dc-ae56-2954ee12006d\\\" /></p>\\n<p>\\\"Release by\\\" dates, meanwhile, are generally estimated at about two weeks past PR complete -- time enough for in-flight PRs to wrap up, release candidates to be built and validated across all languages/environments, documentation and other external repository resources to be staged, and bits to be published.</p>\\n<p>The dates here are replicated for convenience and history. This may not always be entirely up to date; please check the sprint board above or contact the team (cdev) if anything's unclear!</p>\\n<h3 id=\\\"release-planning\\\">Release planning</h3>\\n<p><a href=\\\"./planning.md\\\">SDK planning -- Wiki</a></p>\\n<h3 id=\\\"release-signoff\\\">Release signoff</h3>\\n<p><a href=\\\"https://microsoft.sharepoint.com/teams/Carbon2/_layouts/OneNote.aspx?id=%2Fteams%2FCarbon2%2FSiteAssets%2FCarbon%20Notebook&amp;wd=target%28Release.one%7C47758B05-9653-4BA3-B15F-0737A0AB5880%2F%29\\\">SDK release process -- OneNote</a></p>\",\"id\":null,\"title\":\"AI Cognitive Services SDK Releases\",\"filepath\":\"release.md\",\"url\":\"https://openaisdktestdatastorage.blob.core.windows.net/fileupload-azure_search_index/release.md\",\"metadata\":{\"chunking\":\"orignal document size=1000. Scores=6.6608486Org Highlight count=30.\"},\"chunk_id\":\"0\"},{\"content\":\"<p>Customize your build for Embedded Speech</p>\\n<p>Embedded speech (recognition, synthesis) support is not enabled by default. To enable it, download and configure the following external components:\\n* ONNX runtime\\n * Download build artifacts as instructed in <code>external\\\\onnx_runtime\\\\README.md</code>.</p>\\n<ul>\\n<li>SR runtime and models</li>\\n<li>Download build artifacts as instructed in <code>external\\\\sr_runtime\\\\README.md</code>.</li>\\n<li>Add <code>-DEXTENSION_RNNT_ENABLED=true</code> to Carbon <code>cmake</code> options to enable the feature.</li>\\n<li>It is not necessary to download all SR models if not specifically needed. <code>cxx_api_tests</code> uses <code>FP\\\\en-US\\\\V4\\\\onnx</code> and whatever the latest <code>FP\\\\en-US\\\\V#\\\\onnx</code> and <code>FP\\\\de-DE\\\\V#\\\\onnx</code> models are (<code>#</code> = the highest version number available).</li>\\n<li>If running <code>cxx_api_tests</code>, add <code>--offlineModelPathList=path\\\\to\\\\model(s)</code> to command-line options.</li>\\n<li>\\n<p>Complete embedded SR tests require also embedded TTS, as well as KWS and GStreamer (see <em>Customized extensions</em> in this document).</p>\\n</li>\\n<li>\\n<p>TTS runtime and voices</p>\\n</li>\\n<li>Download build artifacts as instructed in <code>external\\\\offline_tts\\\\README.md</code>.</li>\\n<li>\\n<p>Add <code>-DEXTENSION_HYBRID_TTS_ENABLED=true</code> to Carbon <code>cmake</code> options to enable the feature.</p>\\n</li>\\n<li>\\n<p>1DS C/C++ SDK libraries for embedded speech telemetry on Windows</p>\\n</li>\\n<li>Download build artifacts as instructed in <code>external\\\\cpp_client_telemetry_windows\\\\README.md</code>.</li>\\n</ul>\\n<h4 id=\\\"customized-extensions\\\">Customized extensions</h4>\\n<p>Carbon builds a variety of optional <em>extensions</em> that aren't included in the build project by default. Each has a set of setup instructions, usually involving downloading a build artifact, and each has a cmake flag to enable it in your local build.\\n The \\\"source of truth\\\" for these extensions is the CMakeLists.txt file in the root folder of your clone; search for \\\"EXTENSION_\\\" or \\\"DEXTENSION\\\". As a snap:</p>\\n<table>\\n<thead>\\n<tr>\\n<th>Extension</th>\\n<th>Vision/Speech</th>\\n<th>Build parameter</th>\\n<th>Uses folders</th>\\n</tr>\\n</thead>\\n<tbody>\\n<tr>\\n<td>KWS</td>\\n<td>Speech</td>\\n<td><code>-DEXTENSION_KWS_ENABLED=\\\"ON\\\"</code></td>\\n<td><code>Carbon\\\\external\\\\KWS</code> (See README.md there)</td>\\n</tr>\\n<tr>\\n<td>Audio Compression<br>(Sending Silk audio to the cloud)</td>\\n<td>Speech</td>\\n<td><code>-DEXTENSION_AUDIOCOMPRESSION_ENABLED=\\\"ON\\\"</code></td>\\n<td><code>Carbon\\\\source\\\\extensions\\\\audio-compression</code><br> (TODO is this still used? <code>Carbon\\\\external\\\\silk-codec</code>)</td>\\n</tr>\\n<tr>\\n<td>GStreamer decoder support<br>(Decoding compressed input audio)</td>\\n<td>Speech</td>\\n<td><code>-DEXTENSION_CODEC_ENABLED=\\\"ON\\\"</code></td>\\n<td><code>Carbon\\\\source\\\\extensions\\\\codec</code><br><code>Carbon\\\\external\\\\gstreamer-android</code><br><code>Carbon\\\\external\\\\gstreamer-windows</code></td>\\n</tr>\\n<tr>\\n<td>Media source</td>\\n<td>Vision</td>\\n<td><code>-DEXTENSION_MEDIA_SOURCE_INGESTION_ENABLED=\\\"ON\\\"</code></td>\\n<td><code>carbon\\\\external\\\\media-source-ingestion</code></td>\\n</tr>\\n</tbody>\\n</table>\\n<p><strong>NOTE:</strong> See the instructions in each extension's folder, e.g. <code>carbon/external/kws/readme.md</code>, to ensure a successful local build.</p>\",\"id\":null,\"title\":\"Checkout and Build Carbon on Windows\",\"filepath\":\"setupwinenv.md\",\"url\":\"https://openaisdktestdatastorage.blob.core.windows.net/fileupload-azure_search_index/setupwinenv.md\",\"metadata\":{\"chunking\":\"orignal document size=1194. Scores=0.25740328Org Highlight count=1.\"},\"chunk_id\":\"3\"}],\"intent\":\"[\\\"What is the most common feedback customers give about our product?\\\", \\\"What do customers usually say about our product?\\\", \\\"What are the common complaints or compliments about our product from customers?\\\"]\"}","end_turn":false}]}},"end_turn":false,"finish_reason":null}]}

